if(!Array.prototype.unique){Array.prototype.unique=function(){var unique=[];for(var i=0;i<this.length;i++)if(!unique.includes(this[i]))unique.push(this[i]);return unique;};}
if(!Array.prototype.searchObject){Array.prototype.searchObject=function(nameKey,keyValue){return this.filter(item=>item.hasOwnProperty(nameKey)&&(keyValue==undefined)&&true||(item[nameKey]==keyValue));};}
if(!Array.prototype.groupBy){Array.prototype.groupBy=function(key){return this.reduce((rv,x)=>{(rv[x[key]]=rv[x[key]]||[]).push(x);return rv;},{});};}
if(!Array.prototype.log){Array.prototype.log=function(){console.log(JSON.stringify(this));};}